import React from "react";
import { Sidebar } from "../../components";
import style from "./style.module.css";

export const Dashboard = () => {
  return (
    <div className={style.dashboard}>
      <Sidebar>
        <ul>
          <li>Головна</li>
          <li>Додати паціента</li>
          <li>Додати лікаря</li>
        </ul>
      </Sidebar>
      <div>Content</div>
    </div>
  );
};
